import React, { Component } from 'react';
import { Navbar, Nav, NavLink } from 'react-bootstrap';
import { connect } from 'react-redux'
import { Link, withRouter } from 'react-router-dom';
import logo from '../images/logo.png';
// import {login, register} from '../actions/userActions';

class NavBar extends Component {
  render() {
    return (
      <Navbar collapseOnSelect>
        <Navbar.Brand href="#home">
          <img src={logo} className="img" />
        Freshaluck
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="navlink">
            <NavLink href="/">Good</NavLink>
            <NavLink href="/about/">Now</NavLink>
            <NavLink href="/contact/">Letter</NavLink>
            <NavLink href="/register/">Logout</NavLink>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    )
  }
}

// const mapStateToProps = (state, ownProps) => {
//   const userdetails = ownProps ? state.user.loginSuccess : "error"
//   // console.log(userdetails)
//   return {
//     user: userdetails
//   }
// }

// export default connect(mapStateToProps, {login})(NavBar);
export default NavBar;
